GameLevelResponse::ActionEnum GameLevelResponse::toActionEnum(const utility::string_t& value) const
{
    
    if (value == utility::conversions::to_string_t("DATA")) {
        return ActionEnum::DATA;
    }
    
    if (value == utility::conversions::to_string_t("SAVE")) {
        return ActionEnum::SAVE;
    }
    
    if (value == utility::conversions::to_string_t("DELETE")) {
        return ActionEnum::DELETE;
    }
    
    if (value == utility::conversions::to_string_t("GET")) {
        return ActionEnum::GET;
    }
    
    throw std::invalid_argument("Invalid value for conversion to ActionEnum");
}


const utility::string_t GameLevelResponse::fromActionEnum(const ActionEnum value) const
{
    switch(value)
    {
        
        case ActionEnum::DATA: return utility::conversions::to_string_t("DATA");
        
        case ActionEnum::SAVE: return utility::conversions::to_string_t("SAVE");
        
        case ActionEnum::DELETE: return utility::conversions::to_string_t("DELETE");
        
        case ActionEnum::GET: return utility::conversions::to_string_t("GET");
        
    }
}

GameLevelResponse::ScoringTypeEnum GameLevelResponse::toScoringTypeEnum(const utility::string_t& value) const
{
    
    if (value == utility::conversions::to_string_t("GAME_LEVEL")) {
        return ScoringTypeEnum::GAME_LEVEL;
    }
    
    if (value == utility::conversions::to_string_t("GAME_OBJECT")) {
        return ScoringTypeEnum::GAME_OBJECT;
    }
    
    throw std::invalid_argument("Invalid value for conversion to ScoringTypeEnum");
}


const utility::string_t GameLevelResponse::fromScoringTypeEnum(const ScoringTypeEnum value) const
{
    switch(value)
    {
        
        case ScoringTypeEnum::GAME_LEVEL: return utility::conversions::to_string_t("GAME_LEVEL");
        
        case ScoringTypeEnum::GAME_OBJECT: return utility::conversions::to_string_t("GAME_OBJECT");
        
    }
}


